function searchProjects(e){const n=document.getElementById("search-project-bar").value;console.log(window.location.pathname),"/search/projects"===window.location.pathname?$.ajax({url:"/search/projects?value="+n,type:"GET",success:function(e){document.getElementById("search-value").innerHTML="Search result for '"+n+"'";const s=document.getElementById("search-cards-list");s.innerHTML="";const a=e.data.projects;if(0===a.length)return document.getElementById("search-value").innerHTML="No projects found for '"+n+"'",void(s.innerHTML='\n                <div class="no-projects animate__animated animate__fadeIn">\n                    <i class="fa-solid fa-circle-dot"></i>\n                    <p class="heading">No project found!</p>\n                    <p class="sub-heading">\n                        A project contains all the files, libraries used to build the project. Continue to enter the details of your project \n                        To get started, you should <span>create an project</span>.\n                    </p>\n                </div> ');let t=0;a.forEach((n=>{s.innerHTML+=projectCardDOM(n,e.data.favorites,e.data.time[t++])}))},error:function(e){console.log(e.responseText)}}):window.location.href=`/search/projects?value=${n}`}const projectCardDOM=(e,n,s)=>`\n    <div class="card-container animate__animated animate__fadeIn">\n        <div class="user-info">\n            <img src="${e.user.avatar}" alt="">\n            <p class="user-name"> ${e.user.name} </p>\n            <p class="day">${s}</p>\n        </div>\n\n        <div  class="project-info">\n            <p onclick="window.location.href = '/issues/${e._id}/all'" class="title">${e.title} </p>\n            <p class="description">${e.description} </p>\n\n            <div class="card-footer">\n                <p class="type"><i class="fa-solid fa-circle"></i>${e.type} Application </p>\n                <p id='stars-count' class="stars"><i class="fa-regular fa-star"></i>${e.starsCount}</p>\n            </div>\n            \x3c!-- Check if the project is in favorites or not --\x3e\n            ${n&&n.projects&&n.projects.includes(e.id)?`\n                <div id="starred-${e.id}" onclick="removeFromFavorites('${e.id}', 'starred')" class="star-button">\n                    <i class="fa-solid fa-star"></i>\n                    <p>Starred</p>\n                </div>`:` \n                <div id="star-${e.id}" onclick="addToFavorites('${e.id}', 'star')" class="star-button">\n                    <i class="fa-regular fa-star"></i>\n                    <p>Star</p>\n                </div>\n            `}\n            \n        </div>\n\n        <div onclick="window.location.href = /issues/${e.id}/all" class="issues">\n            <p>${e.issues.length} Issues</p>\n        </div>\n    </div>\n\n`;